import React from 'react'
import "./style.css"
const restaurant = () => {
  return (
    <div>
     <div className='card-container'>
        <div className='card'>
            <div className='card-body'>
                   <span className='card-number card-circle subtle'>1</span>
                   <span className='card-author subtle'>Breakfast</span>
            </div>
        </div>
     </div>

    </div>
  );
};

export default restaurant;
